(1, 'Uso De Suelo Agrícola', 7, 15, 'a', '18 huellas-01.png', 'Uso_agricola', 'Superficie de suelo del tipo agrícola utilizado.', '2018-01-01 00:00:00', NULL, 0),
(2, 'Cambio Climático', 1, 1, 'CO2 eq', '18 huellas-02.png', 'Cambio_climatic', 'Conjunto de emisiones de gases de efecto invernadero (GEI). Uso de GWP como conversor de gases a CO2 eq', '2018-01-01 00:00:00', NULL, 0),
(3, 'Agotamiento Combustibles Fósiles', 1, 1, 'oil eq', '18 huellas-03.png', 'Agot_comb_fosil', 'Consumo de combustibles fósiles (petróleo, gasolina, gas) ', '2018-01-01 00:00:00', NULL, 0),
(4, 'Ecotoxicidad Agua Dulce', 1, 1, '1,4-DB eq', '18 huellas-04.png', 'Ecotox_agua_dul', 'Sustancias o desechos que pueden tener efectos adversos inmediatos o a largo plazo en el medio ambiente. La ecotoxicidad es la resultante del estrés de los tóxicos que actúan en el ambiente.', '2018-01-01 00:00:00', NULL, 0),
(5, 'Eutrofización Agua Dulce', 1, 1, 'P eq', '18 huellas-05.png', 'Eutrof_agua_dul', 'Aumento de nutrientes en el ambiente acuático, resultado de las actividades humanas, es uno de los factores clave en determinar la calidad ecológica del agua', '2018-01-01 00:00:00', NULL, 0),
(6, 'Toxicidad Humana', 1, 1, '1,4-DB eq', '18 huellas-06.png', 'Toxic_humana', 'Exposición a elementos tóxico a través de inhalación (aire urbano y rural) e ingestión (agua dulce, agua marina, suelo agrícola, suelo industrial, suelo natural)', '2018-01-01 00:00:00', NULL, 0),
(7, 'Radiación Ionizante', 1, 1, 'U235 eq', '18 huellas-07.png', 'Radiacion_ioniz', 'Daño a la salud humana debido al vertido de materiales radioactivos al ambiente. ', '2018-01-01 00:00:00', NULL, 0),
(8, 'Ecotoxicidad Marina', 1, 1, '1,4-DB eq', '18 huellas-08.png', 'Ecotox_marina', 'Sustancias o desechos que pueden tener efectos adversos inmediatos o a largo plazo en el medio ambiente. La ecotoxicidad es la resultante del estrés de los tóxicos que actúan en el ambiente.', '2018-01-01 00:00:00', NULL, 0),
(9, 'Eutrofización Marina', 1, 1, 'N eq', '18 huellas-09.png', 'Eutrof_marina', 'Aumento de nutrientes en el ambiente acuático, resultado de las actividades humanas, es uno de los factores clave en determinar la calidad ecológica del agua', '2018-01-01 00:00:00', NULL, 0),
(10, 'Agotamiento De Metales', 1, 1, 'Fe eq', '18 huellas-10.png', 'Agot_minerales', 'Consumo y agotamiento de recursos minerales', '2018-01-01 00:00:00', NULL, 0),
(11, 'Transformación De Suelo Natural', 7, 15, 'a', '18 huellas-11.png', 'Trans_suelo_nat', 'Calcula el total de superficie de suelo natural utilizado, la superficie transformada (m2) y el tiempo de ocupación (años) ', '2018-01-01 00:00:00', NULL, 0),
(12, 'Agotamiento De Ozono', 1, 1, 'CFC-11 eq', '18 huellas-12.png', 'Agot_ozono', 'Emisión de gases que favorecen la destrucción de la capa de ozono a nivel estratosférico. Uso de ODP como conversor de gases a CFC- 11 eq', '2018-01-01 00:00:00', NULL, 0),
(13, 'Formación De Material Particulado', 1, 1, 'PM10 eq', '18 huellas-13.png', 'Form_mat_partic', 'MP10 causan serios problemas a la salud en vías respiratorias. Aerosoles secundarios de MP10 se forman por las emisiones de SO2, NH3 y NOx, entre otros.', '2018-01-01 00:00:00', NULL, 0),
(14, 'Formación De Oxidantes Fotoquímicos', 1, 1, 'NMVOC', '18 huellas-14.png', 'Form_ox_fotoq', 'Conjunto de contaminantes secundarios altamente oxidantes, los cuales se miden a través de su equivalencia con la capacidad oxidante del compuesto químico Ozono (O3)', '2018-01-01 00:00:00', NULL, 0),
(15, 'Acidificación Terrestre', 1, 1, 'SO2 eq', '18 huellas-15.png', 'Acidif_terrest', 'La deposición de sustancias inorgánicas como sulfatos, nitratos y fosfatos, causan un cambio en la acidez del suelo, lo que puede afectar la vegetación', '2018-01-01 00:00:00', NULL, 0),
(16, 'Ecotoxicidad Terrestre', 1, 1, '1,4-DB eq', '18 huellas-16.png', 'Ecotox_terrest', 'Sustancias o desechos que pueden tener efectos adversos inmediatos o a largo plazo en el medio ambiente. La ecotoxicidad es la resultante del estrés de los tóxicos que actúan en el ambiente.', '2018-01-01 00:00:00', NULL, 0),
(17, 'Uso De Suelo Urbano', 7, 15, 'a', '18 huellas-17.png', 'Uso_suelo_urban', 'Superficie de suelo del tipo urbano utilizado.', '2018-01-01 00:00:00', NULL, 0),
(18, 'Agotamiento De Agua', 2, 3, 'H2O eq', '18 huellas-18.png', 'Agot_agua', 'Consumo y agotamiento de agua ', '2018-01-01 00:00:00', NULL, 0),
